MOUSEDISPLY PROC NEAR ;Procedimiento de inicializacion de mouse
	MOV AX, 00H			
	INT 33H
	CMP AX, 00
	JE B90
	MOV AX, 01H			
	INT 33H
	MOV AX, 07H			;posicion inicial
	MOV CX, 350
	MOV DX, 100
	INT 33H
	MOV AX, 07H			;limite horizontal
	MOV CX, 012
	MOV DX, 068
	SHL CX, 03  
	SHL DX, 03
	INT 33H
	MOV AX, 08H			;limite vertical
	MOV CX, 01
	MOV DX, 23
	SHL CX, 03
	SHL DX, 03
	INT 33H
B90: RET
MOUSEDISPLY ENDP
;---------------------------------------------------------
MOUSEPOINTR PROC NEAR
	;MOV COUNT_MOUSE, 0
	MOV AX, 03H
	INT 33H
	CMP BX, 00000001B		;verifica que se haya apachado el click derecho
	JE SEL
	JMP NEXT

NEXT:						;en este segmento verifica que fila se encuentra 
	SHR DX, 03
	CMP DX, TOPROW
	JE EXIT_COLUMB_PRINT
	CMP DX, 09
	JE EXIT_COLUMB_PRINT
	JMP LIMPIAR_MOUSE
	RET

SEL:
	SHR DX, 03
	CMP DX, TOPROW			
	JE EXIT_COLUMB
	CMP DX, 09
	JE VERIFY_POS987
	CMP DX, 10
	JE VERIFY_POS987
	CMP DX, 11
	JE VERIFY_POS987
	CMP DX, 13
	JE VERIFY_POS456
	CMP DX, 14
	JE VERIFY_POS456
	CMP DX, 16
	JE VERIFY_POS123
	CMP DX, 17
	JE VERIFY_POS123
	CMP DX, 18
	JE VERIFY_POS123
	CMP DX, 20
	JE VERIFY_POS0
	CMP DX, 21
	JE VERIFY_POS0
	CMP DX, 22
	JE VERIFY_POS0
	JMP MOUSEPOINTR


;Linea donde estan los botones 0,+/-,%
